import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import HomeIcon from '@material-ui/icons/Home';
import EventNoteIcon from '@material-ui/icons/EventNote';
import AddCircleIcon from '@material-ui/icons/AddCircle';
import NotificationsIcon from '@material-ui/icons/Notifications';
import DirectionsCarIcon from '@material-ui/icons/DirectionsCar';

const useStyles = makeStyles({
  root: {
    width: '100vw',
    position: 'absolute'
  },
});

export default function SimpleBottomNavigation() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  return (
    <BottomNavigation
      value={value}
      onChange={(event, newValue) => {
        setValue(newValue);
      }}
      showLabels
      className={classes.root}
    >
      <BottomNavigationAction label="Recents" icon={<HomeIcon />} />
      <BottomNavigationAction label="Recents" icon={<EventNoteIcon />} />
      <BottomNavigationAction label="Recents" icon={<AddCircleIcon />} />
      <BottomNavigationAction label="Favorites" icon={<NotificationsIcon />} />
      <BottomNavigationAction label="Nearby" icon={<DirectionsCarIcon />} />
    </BottomNavigation>
  );
}
